import React from 'react';

const CollectionsPreview = ({ name, imageUrl, price }) => {
  return (
    <div className="collection-preview">
      <div className="image" style={{ backgroundImage: `url(${imageUrl})` }} />
      <h6>{name}</h6>
      <h6>{price}</h6>
    </div>
  );
};

export default CollectionsPreview;
